function getBLMScriptParams(a){var b=document.getElementsByTagName("script");for(var i=0;i<b.length;i++){if(b[i].src.indexOf("/"+a)>-1){var c=b[i].src.split("?").pop().split("&");var p={};for(var j=0;j<c.length;j++){var d=c[j].split("=");p[d[0]]=d[1]}return p}}return{}}const REMOVEBLMBANNER=()=>{document.getElementsByClassName("BLMheader")[0].remove()};const BLMBANNER=()=>{const params=getBLMScriptParams("blm.js");const position=params.position||"fixed";const bgColor=params.bgColor||"#000";const textColor=params.textColor||"#FFF";const customMsg=params.msg?decodeURI(params.msg):"We Stand In Solidarity.";var css=document.createElement("style");css.type="text/css";var styles=`\n  .BLMheader {\n  \t\tposition: ${position};\n  \t\twidth: 100%;\n  \t\ttext-align: center;\n  \t\tfont-size: 20px;\n  \t\tline-height: 50px;\n  \t\tbackground: ${bgColor};\n  \t\tcolor: ${textColor};\n  \t\tfont-family: 'PT Sans', sans-serif;\n  \t\t-webkit-transition: all 0.4s ease;\n  \t\ttransition: all 0.4s ease;\n      top: 0;\n      left: 0;\n      z-index: 1000000;\n  }\n  .BLMheader > div {\n    padding-top: 6px;\n  }\n\n  .BLMheader > div > img {\n    padding: 0 10px 0 0;\n    margin: 0px;\n    height: 50px;\n  }\n\n  .BLMheader > div > h1, header > div > p {\n    text-align: center;\n    padding: 0px;\n    margin: 0px;\n    display: inline-block;\n    vertical-align: top;\n  }\n\n  .BLMheader > div > p > a {\n    color: ${textColor};\n  }\n\n  .dismissBLM {\n    opacity: 0.5;\n  }\n  `;if(css.styleSheet)css.styleSheet.cssText=styles;else css.appendChild(document.createTextNode(styles));document.getElementsByTagName("head")[0].appendChild(css);const banner=document.createElement("header");banner.className="sticky BLMheader";banner.innerHTML=`\n  <div>\n  <img src="data:image/png;base64," />\n  <h1>${customMsg}</h1>\n  <p>#BlackLivesMatter - <a target='_blank' rel="nofollow noopener" href='https://blacklivesmatters.carrd.co/'>Learn More</a></p>\n  <p><a class='dismissBLM' href='#' onclick='REMOVEBLMBANNER()'>Dismiss</a></p>\n  </div>\n  `;document.body.insertBefore(banner,document.body.childNodes[0])};BLMBANNER();